  false,\n\t\"url\": null,\n\t\"notes\": \"Monitoring report for hay management at
  Kulm Wetland Management District (WMD) for the year 2004.  The goal for this monitoring
  program is to check management objectives with current rotational haying programs
  and what effects or trends are showing in vegetation structure and composition.
  We will monitor litter depth, visual obstruction readings, plant composition, and
  noxious weed abundance in areas that were hayed one, two, and three years ago and
  compare with control areas rested for the previous three years.  This report contains
  a plant association list for Kulm WMD.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
